developper-guide/react-redux/react/compo.body:
Component state
The wrong way
Let's first try to simply add a code by updating the array of codes, and then log the updated codes. We expect the new code to appear below the third code.
function CodeListEditor() {
  const codes = [{
    id: 'code_1',
    label: 'unhappy'
  }, {
    id: 'code_2',
    label: 'happy',
  }, {
    id: 'code_3',
    label: 'very happy'
  }]
  const handleClick = () => {
    codes.push({ id: 'code_4', label: 'very unhappy' })
    console.log('codes:', codes)
  }
  return (


      ...

  )
}




As you notice, it does not quite work: the codes seem to have been updated (there are now 4 codes in our array), but the UI stayed the same.
This is a key feature of React: the app will only be re-rendered when a setState method is called somewhere. To use the setState method, we will need to make some adjustments to our CodeListEditor.
The right way
To use the setState method aforementioned, we need to use a different syntax to describe the component: 
import React from 'react'
class CodeListEditor extends React.Component {
  render() {
    const codes = ...
    return (


        ...

    )
  }
}

We've just copied the body from our component function to the body of another function: the render method of a ES6 class which extends React.Component.
For now, nothing has changed: the UI is still not updating when we try to add a code. But this syntax exposes some additional functionalities. Among them is the option to call the setState method to tell the component something has changed and it should be re-rendered. 
import React from 'react'
class CodeListEditor extends React.Component {
  constructor() {
    super()
    //we initialize the state with the 3 codes
    this.state = {
      codes: [{
        id: 'code_1',
        label: 'unhappy'
      }, {
        id: 'code_2',
        label: 'happy',
      }, {
        id: 'code_3',
        label: 'very happy'
      }]
    }
    this.addCode = () => {
      const { codes } = this.state
      const newId = `code_${codes.length+1}`
      //Instead of updating the codes in place, with `codes.push`, we prefer to
      //make a copy of the initial codes and append the new code at the end.
      const newCodes = [...codes, { id: newId, label: 'very unhappy' }]
      //we can now use `setState` to make this new array of codes part of the
      //component state. The `setState` call will trigger a re-rendering of the
      //component.
      this.setState({
        codes: newCodes
      })
    }
  }
  render() {
    //codes should now be extracted from the component state
    const { codes } = this.state
    return (

        {/* we use the `addCode` method defined in the constructor */}
        Add a code

        {
          codes.map(({ id, label }) => )
        }


    )
  }
}

We intitialize the state of the CodeListEditor component with the 3 already created codes. We then define a addCode function (see arrow functions) which:

creates an id for the newly created code;
creates a copy of the initial codes with a new code at the end (see spread operator) ;
calls setState to update the state of the component; the setState call will trigger a re-rendering of the component.

Now, when we click on the "Add a code" button, the UI updates accordingly.
Play with this pen.

developper-guide/react-redux/react/contr.body:
Control the input
In order to make a code label editable, we will need to pass to each CodeEditor a function that will update the codes held by the CodeListEditor state. For this, we will add the new method editCodeLabel to the CodeListEditor component:
 class CodeListEditor extends React.Component {
   constructor(){
     ...
     //it will update the label for the code at index `i`
     this.editCodeLabel = (i, newLabel) => {
       //we make a copy of the initial codes
       const newCodes = [...this.state.codes]
       //we edit the code at index `i`
       newCodes[i] = {
         //we use the spread operator to start with a copy of the code (a good
         //practice to get used to in order to avoid object mutations)
         ...newCodes[i],
         //we update the `label`
         label: newLabel
       }

       this.setState({
         codes: newCodes
       })
     }
   }

   render() {
     return (

        Add a code

        {
          codes.map(({ id, label }, i) => 
            //`editCodeLabel` method will be used internally by the
            //`CodeEditor` component
             this.editCodeLabel(i, value)}  />)
        }


     )
   }
 }

We passed a new prop to the CodeEditor components: handleChange is the function the component will need to call to take into account label updates. To do that, we need to modify the CodeEditor component: 
 function CodeEditor({ label, handleChange }) {
  return (

       handleChange(e.target.value)} />






  )
}

We added the onChange event handler. The function will be passed a synthetic event, which just works like regular DOM events. So we use this event to get the value of the current input.
We also had to swtich the defaultValue attribute of the input field to value to say to React that this input will be updated from the code.
We could in the same way implement the remove, move up and move down functionalities.
We did not cover how the CodeListEditor will receive the initial codes. Obviously, in a real world scenario, these won't be hard coded in the constructor. It is part of the next sections.

developper-guide/react-redux/redux/compo.body:
A component with Redux
Before diving more into Redux, let's have a look at what the code will look like after switching to Redux to represent the application state: 
function CodeListEditor({ codes, addCode, editCodeLabel }) {
  return (

      { 
        codes.map(( {id, label }) => 

             editCodeLabel(id, val)}
               />

        )
      }

  )
}

The code editor by itself will not be impacted (it was already a stateless component, so it did not contain any state).
Notice that the CodeListEditor:

is now a stateless component represented as a function;
is supposed to be passed by its parent some props: the codes the code list is made of, a function to add a code and one to edit a code (in order to make a fully functional component, we should also pass it some functions to move up, move down and remove a code).

In the next sections, we will see:

how to model the application state;
how to make a component use some piece of state stored in the application state;
how to make the application state change when actions occur.

developper-guide/react-redux/redux/model.body:
Model the state
Before going further, we need to think about how to model the application state. We will not discuss the following choices here, but if you to know more about it, you can read normalizing state shape:

each code has an unique id and a label ;
each code list has an unique id and a label;
a code list holds an array of code ids.

Hence, the state of our application can be represented like this:
{
  codeListById: {
    code_list_1: { //we will actually use random ids
      label: 'mood',
      codes: ['code_1', 'code_2', 'code_3']
    },
    code_list_2: {
      label: 'appetite',
      codes: ['code_4', 'code_5', 'code_6]
    }
  },
  codeById: {
    code_1: {
      label: 'unhappy',
    },
    code_2: {
      label: 'happy'
    },
    code_3: {
      label: 'very happy'
    },
    code_4: {
      label: 'not hungry'
    },
    code_5: {
      label: 'hungry'
    },
    code_6: {
      label: 'starving'
    }
  }
}

Notice that instead of a nested structure where a code list would contain some codes, we opted for a database like representation, where each code list references some code ids, and the actual code descriptions are held in the dedicated codeById object. We will see in the split and combine reducers section why this choice make writing the application easier.

developper-guide/react-redux/redux/first.body:
Introduction to store
Simple Reducer
As it has already been said, the application state will be held by a Redux store. To create a Redux store, we first need to define a reducer. A reducer is a function which takes the application state and an action, and returns a new version of the application state.
To keep things simple for now, we will create a simple reducer which always return the application state from the previous section (we do not value the action for the moment):
function simpleReducer(state, action) {
  return {
    codeListById: {
      code_list_1: { //we will actually use random ids
        label: 'mood',
        codes: ['code_1', 'code_2', 'code_3']
      },
      ...
    },
    codeById: {
      code_1: {
        label: 'unhappy',
      },
      ...
    }
  }
}

Set up
We can then bootstrap the application:

we build a Redux store with the Redux createStore function which takes the reducer as its first argument;
we wrap the CodeListEditor component with the Provider component from React Redux; this will make the store available to each component in the application through the React Redux connect mechanism.

See bootstraping the application for a more detailed presentation of these steps.
import { createStore } from 'redux'
import { Provider } from 'react-redux'

const store = createStore(simpleReducer)

ReactDOM.render(


  ,
  document.getElementById('base')
)

Notice we passed some props to the code list editor: we provided the id of the code list we want to edit.
Connect
With this set up, we can now connect the CodeListEditor component to the store.
import { connect } from 'react-redux'

//The codes will be passed to the `CodeListEditor` through the `connect`
//mechanism. We renamed our `CodeListEditor` function to `CodeListEditorDumb`
//to differentiate it from the component which will be eventually exported
//(see last line).
function CodeListEditorDumb({ codes }) {
  return (

       console.log('trying to add a code')}>
        Add a code


      {
        codes.map(({ id, label }, i) => 
           console.log('a code has changed', val)} />)    
      }


  )
}

//`mapStateToProps` will extract the codes from the state. Its second argument
//(`ownProps`) is the component props. These props were passed through
// ``in the set up. Hence, it is an object
//with an entry called `id`.
const mapStateToProps = (state, ownProps) => {
  //code list id
  const codeListId = ownProps.id
  //For a code list with a given id, we first need to extract an array with
  //the ids this code list is made of.
  const codeIds = state.codeListById[codeListId].codes
  //Then, for each code, we extract some detailed information from the state
  //through the `codesById` entry. Since `CodeEditor` expects a code to look
  //like `{id: 'code_1', label: 'unhappy' }`, we build the codes according to
  //this requirement.
  return codeIds.map(id => ({
    id: id,
    label: state.codeById[id].label
  }))
}

export default connect(mapStateToProps)(CodeListEditorDumb)

Notice that the CodeListEditorDumb expects to be passed an array of codes, but
when we instantiate the CodeListEditor within the Provider with , we passed it the id of the code list. Taking this id and returning the corresponding list of codes is what mapStateToProps will take care of. Then, connect will use mapStateToProps to wrap the initial component into a higher order component, which given some id, will retrieve the codes from the application state, and render the initial component with these codes passed as a prop.
In practice, we don't need to rename our initial component CodeListEditorDumb, since this name is only used locally (in the connect call at the end of the file). See export default to learn more about how exports work.
Our CodeListEditor will now be able to get the information directly from the store. But when we try to add or edit a code, nothing happens except for the logged information in the console. In the next sections, we will see how to use actions to make things happen.
