Les composants avec React
Un élément visuel avec React est appelé un composant. Nous travaillerons dans un premier temps à partir d'une version simplifiée du composant CodeEditor défini dans le fichier src/js/components/code-editor.js:
Figure: Le composant CodeEditor
Afin de promouvoir la conception de composants réutilisables et l'écriture de code modulaire, les composants doivent être aussi élémentaires que possible. Avec cette approche, on peut ensuite construire des composants de plus haut niveau en associant des composants simples. De ce point de vue, le composant CodeEditor devrait être considéré comme l'association de plusieurs composants élémentaires:

le champ de saisie;
le groupe de boutons, qui devrait lui même être scindé en plusieurs composants, un pour chaque bouton.

Cela étant, afin de simplifier et de rester proche du code existant, nous considérerons le composant CodeEditor comme un bloc élémentaire.
Si l'on ignore les instructions relatives au style et à la mise en page, le code HTMLpour l'éditeur de code ressemble à:









Cela peut-être représenté avec React de la façon suivante:
import React from 'react'

export default function CodeEditor() {
