le composant CodeEditor est représenté par une fonction;
cette fonction retourne ce qui ressemble à de l'HTML; cette syntaxe s'appelle JSX et est pratique pour décrire des composants; au cours de la compilation, ce code JSX sera transformé en code JavaScript, et, au final, cette fonction renverra un élément React;
il y a de légères différences entre JSX et HTML (ici, l'attribut className est utilié au lieu de l'attribut class, et l'attribut defaultValue à la place de value);
on exporte (cf. exports) le composant afin de pouvoir l'utiliser ultérieurement pour construire le composant CodeListEditor.

