guide-developpeur/react-redux/react/comp.body:
L'état d'un composant
La mauvaise approche
Essayons d'abord d'ajouter simplement un code en actualisant le tableau contenant les codes, et en affichant ensuite dans la log ce tableau. On s'attend au niveau de l'interface à ce que le nouveau code apparaisse en dessous du troisième code.
function CodeListEditor() {
  const codes = [{
    id: 'code_1',
    label: 'unhappy'
  }, {
    id: 'code_2',
    label: 'happy',
  }, {
    id: 'code_3',
    label: 'very happy'
  }]
  const handleClick = () => {
    codes.push({ id: 'code_4', label: 'very unhappy' })
    console.log('codes:', codes)
  }
  return (


      ...

  )
}




On remarque que cette approche ne fonctionne pas: les codes semblent avoir été actualisés (il y a maintenant 4 codes dans le tableau), mais l'interface n'a pas changé.
C'est une caractéristique essentielle de React: l'application est actualisée seulement lorsque la méthode setState d'un composant est appelée.
La bonne approche
 Pour utiliser cette méthode setState, nous devons au préalable effectuer quelques ajustements au composant CodeListEditor et utiliser une syntaxe différente pour décrire le composant:
import React from 'react'
class CodeListEditor extends React.Component {
  render() {
    const codes = ...
    return (


        ...

    )
  }
}

Nous avons juste copié le corps de notre fonction décrivant le composant dans une autre fonction: la méthode renderd'une classe ES6 qui hérite de React.Component.
Pour l'instant, rien n'a changé: l'interface ne s'actualise toujours pas lorsque l'on ajoute un code. Mais cette syntaxe offre de nouvelles options. Parmi elles, la possiblité d'appeler la méthode setState pour indiquer au composant que quelque chose a changé et qu'il doit être ré-affiché.
import React from 'react'
class CodeListEditor extends React.Component {
  constructor() {
    super()
    //on initialise l'état du composant avec 3 codes
    this.state = {
      codes: [{
        id: 'code_1',
        label: 'unhappy'
      }, {
        id: 'code_2',
        label: 'happy',
      }, {
        id: 'code_3',
        label: 'very happy'
      }]
    }
    this.addCode = () => {
      const { codes } = this.state
      const newId = `code_${codes.length+1}`
      //Au lieu de mettre à jour les codes directement, avec `codes.push`, on
      //préfère réaliser dans un premier temps une copie des codes initiaux et
      //ajouter dans un second temps le nouveau code à la fin.
      const newCodes = [...codes, { id: newId, label: 'very unhappy' }]
      //On peut désormais utiliser `setState` pour prendre en compte ce nouveau
      //tableau dans l'état du composant. L'appel à la méthode `setState`
      //déclenche une actualisation du composant.
      this.setState({
        codes: newCodes
      })
    }
  }
  render() {
    //Les codes sont maintenant extraits de l'état du composant
    const { codes } = this.state
    return (

        {/* on utilise la méthode `addCode` définie dans le constructeur */}
        Add a code

        {
          codes.map(({ id, label }) => )
        }


    )
  }
}

On initialise l'état du composant CodeListEditor avec les 3 codes déjà existants. Puis, on définit la fonction addCode (cf. fonctions flêchées) qui:

crée un identifiant pour le nouveau code;
réalise une copie des codes précédents et ajoute le nouveau code à la fin (cf. utilisation de l'opérateur ... avec les tableaux);
appelle setState pour mettre à jour l'état du composant; cet appel à setState va déclencher un réaffichage du composant.

Désormais, lorsque l'on clique sur le bouton "Add a code", l'interface est actualisée de manière cohérente.
Testez le code avec ce pen.

guide-developpeur/react-redux/react/cont.body:
Controller le champ de saisie
Afin de rendre le libellé d'un code éditable, il est nécessaire de passer à chaque CodeEditor une fonction qui met à jour les codes sauvegardés au sein de l'état du composant CodeLlistEditor. Pour cela, nous ajoutons la méthode editCodeLabel au composant CodeListEditor:
 class CodeListEditor extends React.Component {
   constructor(){
     ...
     //mettre à jour le libellé pour le code à la position `i`
     this.editCodeLabel = (i, newLabel) => {
       //copie des codes de départ
       const newCodes = [...this.state.codes]
       //édition du code à la position `i`
       newCodes[i] = {
         //on utilise l'opérateur ... pour réaliser une copie du code (bonne
         //pratique pour s'habituer à éviter les mutations des objets)
         ...newCodes[i],
         //on met à jour le libellé
         label: newLabel
       }

       this.setState({
         codes: newCodes
       })
     }
   }

   render() {
     return (

        Add a code

        {
          codes.map(({ id, label }, i) => 
            //la méthode `editCodeLabel` sera utilisée pour le composant
            //`CodeEditor`
             this.editCodeLabel(i, value)}  />)
        }


     )
   }
 }

Nous avons passé un nouveau paramètre au composant CodeEditor: handleChange est une fonction que le composant utilisera pour mettre à jour le libellé du code. Pour prendre en compte cette évolution, il convient de modifier le composant CodeEditor: 
 function CodeEditor({ label, handleChange }) {
  return (

       handleChange(e.target.value)} />






  )
}

Nous avons ajouté le gestionnaire d'événements onChange. Cette fonction recevra un synthetic event qui foncionne comme les événements traditionnels du DOM. On utilise donc cet événement pour récupérer la valeur du champ. Nous avons également renommé l'attribut defaultValue en value pour indiquer à React que ce champ sera désormais mis à jour à partir du code.
On pourrait de façon analogue implémenter les fonctions supprimer et déplacer un code.
Nous n'avons pas indiqué pour l'instant comment le composant CodeListEditor recevra les codes initiaux. En pratique, bien sûr, ces codes ne seront pas codés en dur au sein du composant.

guide-developpeur/react-redux/redux/comp.body:
Un composant avec Redux
Avant d'étudier plus en détail Redux, regardons à quoi ressemblera le code pour le composant CodeListEditor lorsque nous utiliserons Redux pour gérer l'état de l'application:
function CodeListEditor({ codes, addCode, editCodeLabel }) {
  return (

      { 
        codes.map(( {id, label }) => 

             editCodeLabel(id, val)}
               />

        )
      }

  )
}

Le composant CodeEditor n'est pas modifié (il s'agissait déjà d'un composant sans état).
On remarque que le composant CodeListEditor:

est désormais un composant sans état représenté par une fonction;
doit recevoir des paramètres: les codes constituant la liste de codes, une fonction pour ajouter un code et une fonction pour mettre à jour un code (pour aller au bout de la démarche, il faudrait également lui passer des fonctions permmetant de supprimer un code ou de le déplacer).

Dans les chapitres suivants, nous verrons:

comment modéliser l'état de l'application;
comment utiliser au sein d'un composant de l'information issue de l'état de l'application;
comment actualiser l'état de l'application quand un changement a lieu.

guide-developpeur/react-redux/redux/mode.body:
Modéliser l'état de l'application
Avant d'aller plus loin, il est nécessaire de réfléchir à la façon de modéliser l'état de l'applcation. Les choix présentés ici ne seront pas discutés, mais pour en savoir plus, cette ressource (normalizing state shape) peut être intéressante. Hypothèses:

chaque code a un identifiant unique id et un libellé label;
chaque liste de codes a un identifiant unique id et un libellé label;
chaque liste de code contient un tableau codes avec les identifiants des codes utilisés.

Ainsi, l'état de l'application peut être représenté de la façon suivante:
{
  codeListById: {
    code_list_1: { //en pratique, on utilise des identifants aléatoires
      label: 'mood',
      codes: ['code_1', 'code_2', 'code_3']
    },
    code_list_2: {
      label: 'appetite',
      codes: ['code_4', 'code_5', 'code_6]
    }
  },
  codeById: {
    code_1: {
      label: 'unhappy',
    },
    code_2: {
      label: 'happy'
    },
    code_3: {
      label: 'very happy'
    },
    code_4: {
      label: 'not hungry'
    },
    code_5: {
      label: 'hungry'
    },
    code_6: {
      label: 'starving'
    }
  }
}

Remarquons qu'au lieu d'un arbre à plusieurs niveaux où un liste de codes contiendrait des codes, on a choisi une représentation à plat (type base de données), où chaque liste de codes contient des identifiants de codes, et les codes en eux-mêmes sont décrits au sein de l'objet codesById. Nous veronns dans la section scinder et associer des reducers en quoi ce choix simplifie l'application.

guide-developpeur/react-redux/redux/firs.body:
Introduction au store
Un reducer simple
Comme cela a déjà été dit, l'état de l'application sera géré par le store. Pour créer un store avec Redux, il est dans un premier temps nécessaire de définir un reducer. Un reducer est une fonction qui prend en arguments l'état de l'application et une action, et retourne une nouvelle version de l'état de l'application qui prend en compte cette action.
Pour simplifier, nous créerons un reducer qui retourne systématiquement l'état de l'application tel que nous l'avons défini dans la précédente section (autrement dit, pour l'instant, nous ne valoriserons pas l'action qui est passée au reducer):
function simpleReducer(state, action) {
  return {
    codeListById: {
      code_list_1: { //en pratique, on utilisera des identifiants aléatoires
        label: 'mood',
        codes: ['code_1', 'code_2', 'code_3']
      },
      ...
    },
    codeById: {
      code_1: {
        label: 'unhappy',
      },
      ...
    }
  }
}

Mise en place
On peut désormais amorcer notre application:

on construit le Redux store grâce à la fonction createStore qui prend le reducer en tant que premier argument;
on intègre le composant CodeListEditor au sein d'un composant Provider fourni par React Redux; le Provider rendra le store accessible à chaque composant par l'intermédiaire de la fonction connect de React Redux.

Cf. amorcer l'application pour une présentation plus détaillée de ces étapes.
import { createStore } from 'redux'
import { Provider } from 'react-redux'

const store = createStore(simpleReducer)

ReactDOM.render(


  ,
  document.getElementById('base')
)

Nous remarquons qu'un paramètre est fourni au composant CodeListEditor: l'identifiant de la liste de codes que l'on souhaite éditer.
Connect
Avec cette configuration, nous pouvons désormais connecter le composant CodeListEditor au store.
import { connect } from 'react-redux'

//Les codes vont être passés au composant `CodeListEditor` grâce à la fonction
//`connect`. Nous avons renommé le `CodeListEditor` en `CodeListEditorDumb``
//pour le différencier du composant qui sera au final exporté (cf. dernière
//instruction).
function CodeListEditorDumb({ codes }) {
  return (

       console.log('trying to add a code')}>
        Add a code


      {
        codes.map(({ id, label }, i) => 
           console.log('a code has changed', val)} />)    
      }


  )
}

//`mapStateToProps` extrait les codes à partir de l'état de l'application. Son
//second argument (`ownProps`) est constitué des paramètres passés au composant
//connecté (cf. `` dans la configuration).
// Ansi, il s'agit d'un objet avec une entrée nommée `id`.
const mapStateToProps = (state, ownProps) => {
  //On extrait l'identifiant de la liste de codes.
  const codeListId = ownProps.id
  //Pour une liste de codes avec un identifiant donné, on extrait dans un
  //premier temps un tableau avec les identifiants des codes qui constituent
  //cette liste de codes.
  const codeIds = state.codeListById[codeListId].codes
  //Ensuite, pour chaque code, on extrait l'information détaillée à partir de
  //l'état, grâce à l'entrée `codesById`. Comme le composant `CodeEditor`
  //attend qu'un code soit représenté de la manière suivante:
  //`{id: 'code_1', label: 'unhappy' }`, on construit les codes afin de
  //satisafaire cette attente.
  return codeIds.map(id => ({
    id: id,
    label: state.codeById[id].label
  }))
}

export default connect(mapStateToProps)(CodeListEditorDumb)

Nous remarquons que le composant CodeListEditorDumb attend en paramètre un tableau de codes, mais lorsque l'on instancie le composant CodeListEditor (cf.  au sein du Provider), on ne lui passe des codes mais l'identifiant d'une liste de codes. Valoriser cet identifient et retourner les codes correspondants est pris en chage par la fonction mapStateToProps. Ensuite, connect utilisera mapStateToProps pour envelopper le composant initial dans un composant de plus haut niveau, qui, à partir d'un identifiant, va récupérer les codes grâce à l'état de l'application, et appeler le composant initial en lui passant ces codes en paramètre.
En pratique, il n'est pas nécessaire de renommer le composant initial en CodeListEditorDumb, puisque ce nom est uniquement utiliés localement (dans l'appel à connect). Cf. export default pour en savoir plus sur le fonctionnement des exports.
Le composant CodeListEditor est désormais capable d'aller chercher l'information directement dans le store. Mais lorsque nous essayons d'ajouter ou d'éditer un code, rien ne se passe, à part le message dans la console. Dans les prochains chapitres, nous verrons comment utiliser des actions pour produire des changements.
