guide-developpeur/react-redux/redux/proc.body:
Reducers et actions
Le reducer que nous avons utilisé dans le précédent chapitre était trivial: l'état ne changeait jamais. En conséquence, nous n'étions pas capables de réagir aux actions de l'utilisateur. Afin de construire un reducer plus adapté, il est nécessaire d'étudier plus précisément le second argument du reducer: l'action.
Une action est un objet JavaScript qui décrit ce qu'il s'est passé. Par exemple, l'action suivante peut être utilisée pour décrire l'édition du libellé d'un code:
const anAction = {
  type: 'EDIT_CODE_LABEL', //quel type d'action a eu lieu ?
  payload: { //détails à propos de cette action
    id: 'code_2', //quel code est concerné ?
    label: 'regular happy' //quel est le nouveau libellé ?
  }
}

Si l'on passe cette action en tant que second argument à notre reducer (l'état défini à la section précédente servant de premier argument), on s'attend à ce qu'en retour, il renvoie un nouvel état, où le libellé pour le code avec l'identifiant code_2 a été remplacé par "regular happy".
const previousState = {
  codeListById: {...}
  codeById: {
    ...
    code_2: {
      label: 'happy'
    }
    ...
  }
}

const newState = simpleReducer(previousState, anAction)

L'object newState attendu est:
{
  codeListById: {...}
  codeById: {
    ...
    code_2: {
      //Le seul changement concerne le libellé de `code_2`.
      label: 'regular happy'
    }
    ...
  }
}

Voici une implémentation possible de ce reducer:
function simpleReducer(state, action) {
  if (action.type === 'EDIT_CODE_LABEL') {
    return {
      //`codeListById` n'est pas impacté par cette action, il référence des
      //identifiants mais ne connaît pas les libellés.
      codeListById: state.codeListById,
      codeById: {
        //cf. notes ci-dessous concernant la syntaxe
        //On conserve tous les codes inchangés...
        ...state.codeById,
        //...sauf pour le code qui a été édité: celui-ci doit être mis à jour
        //pour prendre en compte le nouveau libellé.
        [action.payload.id]: {
          label: action.payload.label
        }
      }
    }
  }
  //On renvoie l'état précédent: cette action n'a pas d'effet sur l'état.
  else return state
}

Un reducer doit être une fonction pure, ce qui siginifie qu'elle ne peut pas modifier l'état initial. L'implémentation ci-dessous n'est donc pas acceptable:
function simpleReducer(state, action){
  if (action.type === 'EDIT_CODE_LABEL') {
    state.codeById[action.payload.id].label = action.payload.label
  }
  return state
}

Elle renvoie bien l'état attendu (avec le libellé "regular happy" pour code_2), mais elle a modifié l'état initial (en fait, l'état initial et le nouvel état sont représentés par le même objet).
L'implémentation du reducer utilise l'opérateur ... et les propriétés dynamiques pour faciliter l'écriture de mises à jour sans modification de l'objet initial.
L'état initial
Un reducer prend l'état précédent et une action, et renvoie le nouvel état. À l'initialisation, il n'y a pas d'état précédent. Une approche fréquente consiste à utiliser les paramètres par défaut d'ES2015 pour donner à l'état une valeur initiale. Dans notre exemple, on pourrait utiliser l'état codé en dur précédemment:
const initialState = {
  codeListById: {
    code_list_1: { ... },
    ...
  },
  codeById: {
    code_1: { ... },
    ...
  }
}

function myReducer(state=initialState, action) {
  ...
}

guide-developpeur/react-redux/redux/disp.body:
Envoyer des actions
Dans le précédent chapitre, nous avons construit un reducer qui à partir de l'action représentée ci-dessous, renvoie un nouvel état de l'application où le libellé pour le code concerné a été mis à jour:
const anAction = {
  type: 'EDIT_CODE_LABEL', //quel type d'action a eu lieu ?
  payload: { //détails à propos de cette action
    id: 'code_2', //quel code est concerné ?
    label: 'regular happy' //que est le nouveau libellé ?
  }
}

Nous avons également vue que grâce au mécanisme de connexion fourni par React Redux, notre application s'affiche à partir de l'information contenue dans le store.
Il nous reste à voir comment notifier le store lorsqu'une action a eu lieu: le reducer doit retourner le nouvel état de l'application. C'est ce qui s'appelle "envoyer une action" au store. Il n'est pas indispensable d'utiliser React Redux pour cela, mais ici encore, la fonction connect rend les choses plus simples.
Créateur d'actions
D'abord, encapsulons notre action dans une fonction qui à partir de l'identifiant d'un code et d'une valeur retournera l'action correspondante:
function editCodeLabel(id, label) {
  return {
    type: 'EDIT_CODE_LABEL',
    payload: {
      id, //ES1015 raccourci pour id: id
      label
    }
  }
}

Plus d'inforamtion à propos de la notation raccourcie.
Ainsi, notre action peut être créée de la manière suivante:
const anAction = editCodeLabel('code_2', 'regular happy')

La fonction editCodeLabel s'appelle un créateur d'actions.
Utiliser le second argument de la fonction connect
On peut retravailler notre exemple précédent en passant un second argument  à la fonction connect:

//On fait l'hypothèse que la fonction `editCodeLabel` importée ci-dessous a été
//définie dans le fichier `actions.js`
import { editCodeLabel } from './actions'

...

//Le composant recevra un paramètre supplémentaire: la fonction
//`editCodeLabel`. Cette fonction est différente de la fonction `editCodeLabel`
//qui a été importée. Il s'agit d'une nouvelle fonction produite par la fonction
//`connect`, à partir de la fonction `editCodeLabel` initiale.
function CodeListEditorDumb({ codes, editCodeLabel }) {
  return (
    ...
      {
        codes.map(({ id, label }, i) => 
          //On utilise la fonction `editCodeLabel` pour gérer chaque éditeur
          //(on utilise une fonction flêchée pour passer le bon identifant en
          //tant que premier argument).
           editCodeLabel(id, val)} />)    
      }
    ...
  )
}

const mapStateToProps = ...

//Le second argument de `connect` est souvent appelé `mapDispatchToProps`. Dans
//sa version la plus simple, il s'agit d'un objet où chaque clé représente
//un créateur d'actions (une fonction qui retourne une action).
const mapDispatchToProps = {
  editCodeLabel: editCodeLabel //on pourrait utiliser le raccourci ES2015
}

export default 
  connect(mapStateToProps, mapDispatchToProps)(CodeListEditorDumb)

Lorsque la fonction editCodeLabel est appelée à partir du composant CodeListEditor (plus précisément, à partir d'un composant CodeEditor), la valeur retournée par la function editCodeLabel initiale sera envoyée directement au store: la fonction connect a encapsulé le créateur d'actions pour envoyer directement l'action au store.
Afin de mieux cerner le fonctionnement de connect, on peut considérer que la fonction editCodeLabel initiale a été remplacée par la fonction suivante:
function editCodeLabelAfterConnect(id, value) {
  //the connect mechanism can access the store
  store.dispatch(editCodeLabel(id, value))
}

Testez le code avec ce pen. Nous remarquons que les codes ont été mis à jour et que l'interface a été actualisée.

guide-developpeur/react-redux/redux/redu.body:
Scinder et associer des reducers
Nous pouvons désormais implémenter la fonctionnalité pour ajouter un code. Pour cela, nous avons besoin:

de définir un créateur d'actions;
de traiter l'action correspondante au sein du reducer.

Le créateur d'actions doit connaître la liste de codes à laquelle le code doit être ajouté:
let lastId = 0
function addCode(codeListId) {
  return {
    type: 'ADD_CODE',
    payload: {
      codeListId,
      id: `new_code_${lastId++}`
    }
  }
}

Nous avons donné un identifiant à notre code. Pour simplifier, cet identifiant est incrémenté automatiquement. En pratique, nous utiliserons un identifiant généré aléatoirement.
La logique du reducer se complexifie:
function simpleReducer(state, action) {
  if (action.type === 'EDIT_CODE_LABEL') {
    ...
  }
  else if (action.type === 'ADD_CODE') {
    //récupérer la liste de codes concernée
    const codeList = state.codeListById[payload.codeListId]
    //récupérer les identifiants des codes de cette liste de codes
    const codes = codeList.codes
    //ajouter un nouveau code à la fin, sans modifier l'objet initial
    const newCodesIds = [...codeIds, payload.id]
    //mettre à jour `codeListById` avec les nouveaux codes
    const codeListById = {
      ...state.codeListById,
      [payload.codeListId]: {
        ...codeList,//on conserve toutes les entrées existantes (en 
                    //l'occurence, le `label` de la liste de codes)
        codes: newCodesIds //on met à jour les identifiants des codes
      }
    }
    //mettre à jour `codesById` avec le nouveau code
    const codeById = {
      ...state.codeById,
      [payload.id]: {
        label: ''
      }
    }
    //on retourne le nouvel état
    return {
      codeListById,
      codeById
    }
  }
  //on renvoie l'état tel quel, cette action n'a pas d'effet sur l'état
  else return state
}

Le code devient rapidement assez long: il est nécessaire de traiter les effets sur les différentes parties de l'état, sans modifier l'état initial (ce qui aurait permis d'avoir une syntaxe plus concise). Grâce à la façon dont nous avons modélisé l'état (une entrée par type d'entité avec des références entre entités grâce aux identifiants, et non pas une structure arborescente où les listes de codes contiendraient la description des codes), on peut facilement scinder le reducer principal en deux plus petits reducers, qui travailleront indépendamment l'un de l'autre:

un reducer pour gérer les listes de codes;
un reducer pour gérer les codes.

On peut ensuite associer ces reducers pour gérer la logique globale de l'application.
import { combineReducers } from 'redux'

function codeListByIdReducer(state, action) {
  const { type, payload } = action
  if (type === 'ADD_CODE') {
    const codeList = state[payload.codeListId]
    return {
      ...state,
      [payload.codeListId]: {
        ...codeList,
        codes: [...codeList.codes, payload.id]
      }
    }
  }
  else return state
}

function codeByIdReducer(state, action) {
  const { type, payload } = action
  if (type === 'EDIT_CODE_LABEL') {
    const code = state[payload.id]
    return {
      ...state,
      [payload.id]: {
        ...code,
        label: payload.label
      }
    }
  }
  else if (action.type === 'ADD_CODE') {
    return {
      ...state,
      [payload.id]: {
        label: ''
      }
    }
  }
  else return state
}

const mainReducer = combineReducers({
  codeListById: codeListByIdReducer,
  codeById: codeByIdReducer
})

On peut maintenant mettre à jour le composant CodeListEditor afin qu'il reçoive en paramètre la fonction addCode (le créateur d'actions enveloppé dans une fonction qui permet d'envoyer l'action directement au store):
//Le créateur d'action `addCode` a besoin de l'identifiant de la liste de
//la liste de codes à laquelle le code est ajouté. La fonction `addCode``
//qui est passée au composant `CodeListEditorDumb` a donc besoin de cet 
//identifiant également. Il est récupérable à partir du paramère `id`:
//lorsque l'on appelle ``, le
//paramètre `id` est passé au `CodeListEditor`, et la fonction `connect``
//le fait suivre au composant `CodeListEditorDumb`
function CodeListEditorDumb({ id, codes, editCodeLabel, addCode }) {
  return (

       addCode(id) }>
        Add a code


      ...

  )
}

Vous pouvez tester le code avec ce pen

guide-developpeur/react-redux/redux-form.body:
Redux Forms
La libraire Redux Forms permet de gérer l'état de votre formulaire via Redux.
Les trois parties primordiales pour configurer Redux Forms dans notre application sont :

l'utilisation de la méthode reduxForm permettant de détecter automatiquement les intéractions avec le formulaire, et d'appeler les actions Redux associées.
l'utilisation des composants Field ou FieldArray afin de construire le formulaire. Ces composants peuvent s'utiliser avec des éléments HTML natifs de formulaire (input, textarea), mais également avec nos propres composants. Une interface devra est respectée, et sera présentée plus loin dans cette documentation.
l'utilisation du reducer de la librairie afin de pouvoir gérer les différentes actions émises. Dans notre projet, cette configuration est définie dans le fichier src/reducers/index.js

import { combineReducers } from 'redux';
import { reducer as form } from 'redux-form';

export default integrityChecker(
  combineReducers({
    form,
  }),
);
reduxForm
Afin de connecter votre formulaire au store Redux, il sera nécessaire d'exporter le composant retourné par la méthode reduxForm. Ceci permettra à Redux Forms de détecter toutes les intéractions que l'utilisateur aura, afin de mettre à jour le store. Vous pouvez par exemple regarder le formulaire utilisé pour la création d'un questionaire
export default reduxForm({
  form: 'component',
})(QuestionNewEdit);
Cette méthode prend un objet avec un seul paramètre obligatoire, le nom du formulaire, qui sera utilisé pour nommer les données de votre formulaire dans le store.
Les données insérées seront passées en paramètres de la méthode exécutée lorsque l'événement submit du formulaire sera émis. Par exemple, toujours pour le formulaire de création d'un questionnaire, voici la méthode gérant l'événement submit (définie dans le composant ComponentNewContainer)
const submit = values => {
    createComponent(values, parentId, weight, type).then(updateParentChildren).then(orderComponents).then(result => {
        const { payload: { id } } = result;
        setSelectedComponentId(id);
        if (onSuccess) onSuccess(id);
    });
};
Voici des exemples d'actions gérées par Redux Forms. A chaque action, Redux Forms mettre à jour le store, et régénérera le rendu du formulaire : FOCUS, CHANGE, BLUR, SUBMIT, ...
Composants Custom
Il est nécessaire d'utiliser le composant Field afin de connecter notre champs au store.
Ce composant peut être utilisé avec des champs HTML, mais également avec nos propres composants, si nous désirons factoriser notre code. Ces composant sont situés dans le répertoire src/layout/forms/controls. Ces composants permettent par exemple d'uniformiser la gestion du style, des labels ou encore des messages d'erreurs.
Ces composants doivent respectés une certaine interface afin de pouvoir bénéficier de Redux Forms.
Si vous n'avez pas de manipulations à réaliser sur la données insérées, il suffit de passer la propriété input valorisée par le composant Field et de la passer comme props à l'élément HTML/React. Vous pouvez par exemple regarder l'implémentation du composant input.jsx
Error: file not found: /github/workspace/local_source/src/forms/controls/input.jsx

Si vous devez faire des manipulation de la donnée, avant de synchroniser le store, lors de l'initialisation de votre composant, vous pouvez utiliser la propriété passée en paramètre props.input.value afin d'accéder à la valeur par défaut de votre champ, et lorsque que l'utilisateur a inséré une donnée, vous devez manuellement appeler la méthode props.input.onChange.
Pour passer le composant à utiliser par Field, vous devez utiliser le paramètre component :


Grâce à la propriété meta, vous pouvez également récupérer des métadonnées gérées automatiquement par Redux Forms, comme par exemple l'état de validité du champ, est-ce que celui-ci a déjà eu le focus... Ces propriétés sont mis à jour lorsque les actions définies précédemment (FOCUS, ...) sont émises par la librairie.
Validations des données
La validations des données peut se faire de deux manières.

Soit en définissant une méthode de validation en paramètre de la méthode reduxForm. Cette méthode prendra en paramètre les différentes valeurs du formulaire, et devra retourner un objet correspondant aux différentes erreurs.

Voici un example de validation d'un formulaire utilisant cette syntaxe :
