La deuxième syntaxe pour valider un formulaire est en définissant un tableau de fonctions de validation pour chaque champ du formulaire. Redux Form ne propose pas de validateur par défaut, vous devez créer ces fonctions manuellement. Dans notre application, ces fonctions de validation sont définies dans le fichier validation-rules.js.

