Sauvegarder et récupérer des questionnaires
Ce service est utilisé pour sauvegarder et récupérer les questionnaires.
Configuration
Ce service partage l'URL de base de l'API, fournie par la méthode getBaseURI, avec le service de visualisation. Lorsque que l'on travaille sur un serveur de développement, cette URL doit être définie dans le fichier .env dans la variable REACT_APP_API_URL. Pour un déploiement sur un serveur apache, il faut surcharger la variable POGUES_API_BASE_HOST dans le fichier configuration.json se trouvant dans le dossier public.
Représentation en JSON
Pour l'instant, la représentation du questionnaire pour ce service Web est légèrement différente de la description formelle fournie par le modèle de données Pogues. Ces deux représentations devront fusionner dans le futur (pour ne conserver que la représentation qui satisfait le modèle de données).
